import React from 'react';

import AppProvider from './hooks/index';

// import SignUp from './pages/signup';
import SignIn from './pages/signin';
import GlobalStyle from './styles/global';

const App: React.FC = () => (
  <>
    <AppProvider>
      <SignIn />
    </AppProvider>

    <GlobalStyle />
  </>
);

export default App;
